

def solution(s1, s2):
    s1_ch = [ord(ch) - ord('a') for ch in s1]
    s2_ch = [ord(ch) - ord('a') for ch in s2]

    target = [0] * 26

    for value in s1_ch:
        target[value] += 1

    window = [0] * 26
    for i, v in enumerate(s2_ch):
        window[v] += 1
        if i - len(s1) >= 0:
            window[s2_ch[i - len(s1)]] -= 1
        if window == target:
            return True
    return False

